css:
@-moz-document domain("lensart.ru") {
.darkgrad25, .darkgrad30, .lightgrad45, .lightgrad45h, .tabforebottom {background-image: none !important;}
form, .back, .light, .lightgrad45, .lightgrad45h, .incognito {background-color: #1a1a1a !important;}
.dark:not([style="padding: 5px;"]):not([style="background-color: #00cc33;"]), .darkgrad25, .darkgrad30 {background-color: #373737 !important;}
.quotearea, [class^=edit], .pb {background-color: #0a0a0a !important; border: solid 1px #5c5c5c !important;}
[cellspacing="10"] * :not([class^="button"]) {color: #ddd;}
.visited, .visited * {color: #ace !important;}
[style*="rgb(128, 0, 255)"] {color: #bf80ff !important;}
.plaintext [style="color: #000000;"], [style*="color: black;"], [style="color: #ffffff;"] {color: #ddd !important;}
[height="26"] *, [style="background-color: #cecbce;"] * {color: #000 !important;}
[for*=off] * {color: #7bf !important;}
#sgr_drophead {display: none !important;}
#sgr_dropbox1, #sgr_dropbox2 {display: table-row !important;}
}
